import Main from './component/Main';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import About from './component/About';

function App() {
  return (

    <BrowserRouter>
    <div className="App">
      <Routes>
        <Route index element ={<Main />} />
        <Route path="about"/>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
